//     <>
//       <div id="demo" className="mb-3">
//         <div className="">
//           <div className="row">
//             <div className="span12">
//               <div id="owl-example" className="owl-carousel">

//               </div>
//             </div>
//           </div>
//         </div>
//       </div>
//     </>
//   );
// };

export default Story;
